INSERT INTO `knowledgebase` (`kb_id`, `kb_name`, `kb_content`, `kb_status`, `created_at`, `updated_at`, `deleted_at`, `field_id`, `user_id`) VALUES
	(19, 'aktivitas hari ini', '<p>.</p>', 1, '2025-08-20 22:02:44', '2025-08-21 05:02:44', '2025-08-21 05:02:44', 2, 17),
	(20, 'alpan', '<p>knhdkashkd</p>', 1, '2025-08-20 22:02:48', '2025-08-21 05:02:48', '2025-08-21 05:02:48', 9, 17),
	(21, 'Format Uraian Pekerjaan', '<p><strong>NAMA : FULAN<br>JABATAN : NOC</strong><br><br><strong style="text-decoration: underline;">URAIAN PEKERJAAN</strong></p><ol><li>Bla Bla Bla</li><li>Bla Bla Bla</li></ol>', 1, '2025-08-26 18:01:07', '2025-08-27 01:01:07', NULL, 5, 49),
	(22, 'TESTING', '<p>OKE</p>', 0, '2025-08-21 00:59:30', '2025-08-21 07:59:30', '2025-08-21 07:59:30', 7, 14),
	(23, 'Data Odf ALL POP', '<p><a href="https://docs.google.com/spreadsheets/d/1F7luyAEsFfJOCd_ivUySTpUCBUjk9uuSJFeQ92Zs0V4/edit?gid=982047872#gid=982047872">https://docs.google.com/spreadsheets/d/1F7luyAEsFfJOCd_ivUySTpUCBUjk9uuSJFeQ92Zs0V4/edit?gid=982047872#gid=982047872</a></p>', 1, '2025-08-21 02:45:01', '2025-08-21 09:45:01', '2025-08-21 09:45:01', 9, 21),
	(24, 'Format Uraian Pekerjaan', '<p>NAMA : APRIL ANTONI<br>JABATAN : AKTIVASI</p><p>URAIAN PEKERJAAN</p><p>- Melakukan survey pada Bmap data gardu yg di berikan pak Apri Ismanto</p><p>&nbsp; Dengan hasil RAB estimasi sementara, jarak tarikan, petikan core dari JB terdekat / spare kabel terdekat ataupun gardu terdekat</p><p>&nbsp; dan menentukan sub pop terdekat.</p><p>- Melakukan survey bersama mitra</p>', 1, '2025-08-26 18:21:56', '2025-08-27 01:21:56', NULL, 6, 8),
	(25, 'Format Uraian Pekerjaan', '<p>1. Manage Core Switch<br>2. Manage Router Backbone MPLS<br>3. Manager Router BGP IP Transit<br>4. Manage Switch Scada Backbone&nbsp;<br>5. Manage Wireless Controller<br>6. Manage Security Device - Application<br>&nbsp; &nbsp; a. Firewall Fortigate<br>&nbsp; &nbsp; b. FortiAnalyzer<br>&nbsp; &nbsp; c. Forti Manager<br>&nbsp; &nbsp; d. Nozomi Guardian<br>&nbsp; &nbsp; e. EdgeOne by TXOne<br>&nbsp; &nbsp; f. StellarOne by TXOne<br>&nbsp; &nbsp; g. Kaspersky Mail Gateway<br>7. Manage Network Monitoring Tools<br>&nbsp; &nbsp; a. Manage Engine OP Manager&nbsp;<br>&nbsp; &nbsp; b. Zabbix<br>8. Manage Authentication and Backup Configuration Switch<br>&nbsp; &nbsp; a. Ansbile - Automation Server<br>&nbsp; &nbsp; b. TFTP Server<br>&nbsp; &nbsp; c. Radius Server<br>9. Manage DHCP Server by Efficient IP<br>10. Manage IP Management by PHPIPAM<br>11. Manage NS Record - IP Public<br>12. Manage NTP Server<br><br></p>', 1, '2025-08-21 23:54:22', '2025-08-22 06:54:22', NULL, 3, 23),
	(26, 'contoh', '<p>contoh</p>', 1, '2025-08-24 23:46:12', '2025-08-25 06:46:12', '2025-08-25 06:46:12', 5, 1),
	(27, 'Kegiatan Preventive Maintenace ODP Tiban Housing', '<p>Kegiatan Preventive Maintenance ODP Tiban Housing yang pudar warna dan logo PLN Batam<br>ODP Tiban Housing D04 C10&nbsp;</p><div class="attachment-gallery attachment-gallery--2"><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image/jpeg&quot;,&quot;filename&quot;:&quot;Gambar WhatsApp 2025-08-22 pukul 09.59.09_49fbbab2.jpg&quot;,&quot;filesize&quot;:172684,&quot;height&quot;:1600,&quot;href&quot;:&quot;/storage/uploads/ufDRWcgZfMbKOCcphoxBVToz05ygkgRNCqJEefof.jpg&quot;,&quot;url&quot;:&quot;/storage/uploads/ufDRWcgZfMbKOCcphoxBVToz05ygkgRNCqJEefof.jpg&quot;,&quot;width&quot;:1200}" data-trix-content-type="image/jpeg" data-trix-attributes="{&quot;caption&quot;:&quot;sebelum&quot;,&quot;presentation&quot;:&quot;gallery&quot;}" class="attachment attachment--preview attachment--jpg"><a href="/storage/uploads/ufDRWcgZfMbKOCcphoxBVToz05ygkgRNCqJEefof.jpg"><img src="/storage/uploads/ufDRWcgZfMbKOCcphoxBVToz05ygkgRNCqJEefof.jpg" width="1200" height="1600"><figcaption class="attachment__caption attachment__caption--edited">sebelum</figcaption></a></figure><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image/jpeg&quot;,&quot;filename&quot;:&quot;Gambar WhatsApp 2025-08-22 pukul 09.59.09_e54d3dc7.jpg&quot;,&quot;filesize&quot;:182089,&quot;height&quot;:1600,&quot;href&quot;:&quot;/storage/uploads/9pXNnCnfjbeirmuay6tOkrNwfVG4npwx6kYGINAM.jpg&quot;,&quot;url&quot;:&quot;/storage/uploads/9pXNnCnfjbeirmuay6tOkrNwfVG4npwx6kYGINAM.jpg&quot;,&quot;width&quot;:1200}" data-trix-content-type="image/jpeg" data-trix-attributes="{&quot;caption&quot;:&quot;Sesudah&quot;,&quot;presentation&quot;:&quot;gallery&quot;}" class="attachment attachment--preview attachment--jpg"><a href="/storage/uploads/9pXNnCnfjbeirmuay6tOkrNwfVG4npwx6kYGINAM.jpg"><img src="/storage/uploads/9pXNnCnfjbeirmuay6tOkrNwfVG4npwx6kYGINAM.jpg" width="1200" height="1600"><figcaption class="attachment__caption attachment__caption--edited">Sesudah</figcaption></a></figure></div>', 1, '2025-08-24 18:24:17', '2025-08-25 01:24:17', NULL, 2, 13),
	(28, 'FORMAT URAIAN PEKERJAAN', '<h3><br></h3><p>1. Manage Dashboard FTTH :</p><p>- Dashboard Pelanggan FTTH</p><p>- Dashboard GRAFANA FTTH</p><p>- Data Homepass FTTH</p><p>-&nbsp; Timeline/Laporan pekerjaan harian FTTH</p><p>- TIMELINE INCREASE REVENUE 2025</p><p>- SLA FTTH &amp; FTTx</p><p>- LAPORAN KOMINFO</p><p>- DATA VLAN MITRA FTTH</p><p>2. Manage and Monitoring Perangkat Aktif dan Pasif Jaringan FTTH PLN Batam.&nbsp;</p><p>- <strong>OLT (Optical Line Terminal) - Aktif </strong><br>&nbsp;Perangkat aktif yang terletak di pusat jaringan/POP. OLT berfungsi sebagai pusat pengendali dan pembagi sinyal optik ke berbagai cabang (ONU atau ONT).</p><p>- <strong>ODF (Optical Distribution Frame) - Pasif</strong><br> Rak yang berisi panel-panel optik yang berfungsi untuk mengatur dan mendistribusikan serat optik.</p><p>- <strong>ODC (Optical Distribution Cabinet) - Pasif</strong><br> Kabinet optik yang berisi splitter dan konektor optik. Fungsinya untuk membagi sinyal optik dari feeder ke beberapa distribusi.</p><p>- <strong>ODP (Optical Distribution Point) - Pasif</strong><br> Titik distribusi optik yang terletak lebih dekat ke pelanggan. ODP berfungsi untuk membagi sinyal optik dari distribusi ke beberapa drop.</p><p>-&nbsp;<strong>ONT (Optical Network Terminal) - Aktif</strong><br> Perangkat yang terletak di sisi pelanggan. ONT berfungsi untuk mengubah sinyal optik menjadi sinyal listrik yang dapat digunakan oleh perangkat pelanggan.</p><p>3. Kordinasi dan monitoring kegiatan team Lapangan/Teknis FTTH.</p><p>4. Kordinasi dengan mitra PLN Batam terkait Pengecekan Laporan Gangguan, Aktivasi pelanggan baru dan Pemberhentian Pelanggan.</p><p>5. Monitoring dan Manage progres pekerjaan Preventive Maintenance / Urgent Maintenance.</p><p>6. Update Perubahan/penambahan Drawing Core FTTH PLN Batam.</p><p><br></p>', 1, '2025-08-26 08:20:16', '2025-08-26 15:20:16', NULL, 8, 19),
	(29, 'SOP PENANGANAN GANGGUAN KABEL KETARIK BEKO_PELEBARAN JALAN', '<p><a href="https://docs.google.com/document/d/1ueYdIt31mElUJkBWjH93Sm6CYG2rffi-/edit">https://docs.google.com/document/d/1ueYdIt31mElUJkBWjH93Sm6CYG2rffi-/edit</a></p>', 1, '2025-08-25 23:49:02', '2025-08-26 06:49:02', NULL, 9, 21),
	(30, 'Uraian Pekerjaan', '<p>1. Manage Core Switch<br>2. Manage Router Backbone MPLS<br>3. Manager Router BGP IP Transit<br>4. Manage Switch Scada Backbone&nbsp;<br>5. Manage Wireless Controller<br>6. Manage Security Device - Application<br>&nbsp; &nbsp; a. Firewall Fortigate<br>&nbsp; &nbsp; b. FortiAnalyzer<br>&nbsp; &nbsp; c. Forti Manager<br>&nbsp; &nbsp; d. Nozomi Guardian<br>&nbsp; &nbsp; e. EdgeOne by TXOne<br>&nbsp; &nbsp; f. StellarOne by TXOne<br>&nbsp; &nbsp; g. Kaspersky Mail Gateway<br>7. Manage Network Monitoring Tools<br>&nbsp; &nbsp; a. Manage Engine OP Manager&nbsp;<br>&nbsp; &nbsp; b. Zabbix<br>8. Manage Authentication and Backup Configuration Switch<br>&nbsp; &nbsp; a. Ansbile - Automation Server<br>&nbsp; &nbsp; b. TFTP Server<br>&nbsp; &nbsp; c. Radius Server<br>9. Manage DHCP Server by Efficient IP<br>10. Manage IP Management by PHPIPAM<br>11. Manage NS Record - IP Public<br>12. Manage NTP Server</p><p>13. Pembuatan Report Laporan SLA Mingguan OPMANAGER PLUS DAN OPMANAGER</p><p>14. Pembuatan Report Bulanan PLN BATAM</p><p>15. Pembuatan Report Bulanan Pemeliharaan</p>', 1, '2025-08-26 18:15:06', '2025-08-27 01:15:06', NULL, 3, 25),
	(31, 'Membuat Content Slide Show di Aplikasi JARTI', '<ol><li>Pilih menu <strong>Content</strong> di sebelah kiri<figure data-trix-attachment="{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:18528,&quot;height&quot;:204,&quot;href&quot;:&quot;/storage/uploads/XTQjntFDgvoqTr2zZFshx5D07xK3CFgvHV738FmJ.png&quot;,&quot;url&quot;:&quot;/storage/uploads/XTQjntFDgvoqTr2zZFshx5D07xK3CFgvHV738FmJ.png&quot;,&quot;width&quot;:682}" data-trix-content-type="image/png" data-trix-attributes="{&quot;caption&quot;:&quot;Menu Content&quot;,&quot;presentation&quot;:&quot;gallery&quot;}" class="attachment attachment--preview attachment--png"><a href="/storage/uploads/XTQjntFDgvoqTr2zZFshx5D07xK3CFgvHV738FmJ.png"><img src="/storage/uploads/XTQjntFDgvoqTr2zZFshx5D07xK3CFgvHV738FmJ.png" width="682" height="204"><figcaption class="attachment__caption attachment__caption--edited">Menu Content</figcaption></a></figure></li><li>Di halaman Content akan terlihat daftar content yang telah di input. Untuk membuat Content baru klik tombol biru disebelah kanan atas yang bertuliskan <strong>Buat Content</strong><br><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:410782,&quot;height&quot;:1428,&quot;href&quot;:&quot;/storage/uploads/EUoaPY1f2vJTNP3veojoRou26MxiJvSwmVEicp1b.png&quot;,&quot;url&quot;:&quot;/storage/uploads/EUoaPY1f2vJTNP3veojoRou26MxiJvSwmVEicp1b.png&quot;,&quot;width&quot;:2538}" data-trix-content-type="image/png" data-trix-attributes="{&quot;caption&quot;:&quot;Halaman Content&quot;,&quot;presentation&quot;:&quot;gallery&quot;}" class="attachment attachment--preview attachment--png"><a href="/storage/uploads/EUoaPY1f2vJTNP3veojoRou26MxiJvSwmVEicp1b.png"><img src="/storage/uploads/EUoaPY1f2vJTNP3veojoRou26MxiJvSwmVEicp1b.png" width="2538" height="1428"><figcaption class="attachment__caption attachment__caption--edited">Halaman Content</figcaption></a></figure></li><li>Pada halaman Buat Content, isi kolom Judul, Deskripsi, dan Foto.<br>Lalu kik tombol biru dengan tulisan <strong>Buat</strong><br><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:153112,&quot;height&quot;:1208,&quot;href&quot;:&quot;/storage/uploads/5InQkltOk8sPWls5v3RKFz0yg4tN8IbpxVQPsTjR.png&quot;,&quot;url&quot;:&quot;/storage/uploads/5InQkltOk8sPWls5v3RKFz0yg4tN8IbpxVQPsTjR.png&quot;,&quot;width&quot;:2536}" data-trix-content-type="image/png" data-trix-attributes="{&quot;presentation&quot;:&quot;gallery&quot;}" class="attachment attachment--preview attachment--png"><a href="/storage/uploads/5InQkltOk8sPWls5v3RKFz0yg4tN8IbpxVQPsTjR.png"><img src="/storage/uploads/5InQkltOk8sPWls5v3RKFz0yg4tN8IbpxVQPsTjR.png" width="2536" height="1208"><figcaption class="attachment__caption"><span class="attachment__name">image.png</span> <span class="attachment__size">149.52 KB</span></figcaption></a></figure></li><li>Selesai, Content kamu akan tampil di Slide Show di halaman utama Aplikasi JARTI</li></ol>', 1, '2025-08-26 18:34:13', '2025-08-27 01:34:13', NULL, 5, 49),
	(32, 'Format Uraian Pekerjaan', '<p>Uraian Pekerjaan</p><p>1.Survey jalur melalui BMAP untuk mendapatkan estimasi jarak kabel yg akan di tarik.dari data gardu yang sudah di bagikan sama pak Apri</p><p>2.Survey kelapangan bersama Vendor untuk menentukan route kabel dari FO terdekat ke arah Gardu yang akan di tuju.dan menentukan Uplinknya dari POP terdekat.</p><p><br></p>', 1, '2025-08-26 18:37:37', '2025-08-27 01:37:37', NULL, 6, 9),
	(33, 'Konfigurasi Access Point Cisco ', '<p><a href="https://drive.google.com/drive/folders/1rs4kuxrpG9-VtkfuGl7JDL2n8Gu58RkZ">https://drive.google.com/drive/folders/1rs4kuxrpG9-VtkfuGl7JDL2n8Gu58RkZ</a></p>', 1, '2025-08-26 19:10:06', '2025-08-27 02:10:06', '2025-08-27 02:10:06', 7, 16),
	(34, 'Konfigurasi Access Point Cisco ', '<ol><li>ALAT KERJA&nbsp;</li></ol><p><br></p><ol><li>&nbsp;ALAT KERJA :</li><li>1. Laptop</li><li>2. Kabel console</li></ol><p><br><br></p><ol><li>A.<span style="text-decoration: underline;"> LANGKAH KERJA&nbsp;</span></li></ol><p>1. Konfigurasi access point</p><ol><li>1.1 Koneksikan kabel console dari laptop ke access point</li><li>1.2 Kemudian masuk ke device manager</li><li>1.3 Pastikan di COM berapa terkoneksi</li><li>1.4 Kemudian masuk ke putty</li><li>1.5 Untuk login ke access point gunakan username dan password default (username : cisco, Password : Cisco)</li><li>1.6 Kemudian ketik script :</li></ol><p><em>&nbsp;capwap ap primary-base wlc1 10.28.252.191 (untuk wlc 5508)</em></p><p><em>capwap ap primary-base wlcbright 10.28.252.193 (untuk wlc 9800)</em></p><ol><li>Kemudian ketik sh run untuk memastikan konfigurasi jika sudah maka</li><li>Selesai, untuk konfigurasi access point selesai.</li></ol><p><br><br></p><p><br></p>', 1, '2025-08-26 19:15:43', '2025-08-27 02:15:43', NULL, 7, 16);
